// ==UserScript==
// @name         页面时间追踪器及摘要与饼图
// @name:zh      页面时间追踪器及摘要与饼图
// @name:en      Page Time Tracker with Summary and Pie Chart
// @namespace    http://tampermonkey.net/
// @license      MIT
// @version      1.8
// @icon          data:image/webp;base64,
// @description  页面时间统计
// @description:en Page time statistics
// @author       lbihhe
// @match        *://*/*
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_openInTab
// @grant        GM_registerMenuCommand
// @downloadURL https://update.greasyfork.org/scripts/499967/%E9%A1%B5%E9%9D%A2%E6%97%B6%E9%97%B4%E8%BF%BD%E8%B8%AA%E5%99%A8%E5%8F%8A%E6%91%98%E8%A6%81%E4%B8%8E%E9%A5%BC%E5%9B%BE.user.js
// @updateURL https://update.greasyfork.org/scripts/499967/%E9%A1%B5%E9%9D%A2%E6%97%B6%E9%97%B4%E8%BF%BD%E8%B8%AA%E5%99%A8%E5%8F%8A%E6%91%98%E8%A6%81%E4%B8%8E%E9%A5%BC%E5%9B%BE.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // 仅在顶层窗口运行，避免在 iframe 中重复注册菜单命令
    if (window.top !== window.self) {
        return;
    }

    /***************************************
     * 用户设置区：数据保存天数配置
     ***************************************/
    // 默认仅保存最近30天的数据，用户可通过控制面板修改此值
    const DEFAULT_MAX_DAYS = 30;
    let maxDays = GM_getValue('maxDays', DEFAULT_MAX_DAYS);

    GM_registerMenuCommand('设置数据保存天数 (当前: ' + maxDays + ' 天)', function() {
        const newDays = prompt("请输入数据保存的天数", maxDays);
        if (newDays !== null) {
            const parsedDays = parseInt(newDays, 10);
            if (!isNaN(parsedDays) && parsedDays > 0) {
                maxDays = parsedDays;
                GM_setValue('maxDays', maxDays);
                alert("数据保存天数已更新为 " + maxDays + " 天");
            } else {
                alert("请输入有效的天数");
            }
        }
    });

    /***************************************
     * 计时及数据存储部分
     ***************************************/
    // 初始化开始时间和原始标题
    const startTime = new Date();
    const originalTitle = document.title;

    // 格式化时间为分钟和秒
    function formatTimeMS(seconds) {
        const minutes = Math.floor(seconds / 60);
        const remainingSeconds = seconds % 60;
        return `${minutes}m ${remainingSeconds}s`;
    }

    // 更新标题栏中的时间显示
    function updateTitle() {
        const currentTime = new Date();
        const timeSpent = Math.floor((currentTime - startTime) / 1000);
        document.title = `${originalTitle} - ${formatTimeMS(timeSpent)}`;
    }

    // 存储当前页面访问数据
    function storeVisit() {
        const endTime = new Date();
        const timeSpent = Math.floor((endTime - startTime) / 1000);
        const pageData = {
            url: window.location.href,
            title: originalTitle,
            timeSpent: timeSpent,
            date: startTime.toDateString() // 使用日期字符串保存
        };

        let visits = GM_getValue('pageVisits', []);
        visits.push(pageData);
        GM_setValue('pageVisits', visits);
    }

    // 获取 URL 对应的域名
    function getDomain(url) {
        const a = document.createElement('a');
        a.href = url;
        return a.hostname;
    }

    // 清除旧数据，仅保留最近 maxDays 天的数据
    function clearOldData() {
        let visits = GM_getValue('pageVisits', []);
        const now = new Date();
        visits = visits.filter(visit => {
            const visitDate = new Date(visit.date);
            const diffTime = now - visitDate;
            const diffDays = diffTime / (1000 * 60 * 60 * 24);
            return diffDays <= maxDays;
        });
        GM_setValue('pageVisits', visits);
    }

    // 删除所有数据
    function deleteAllData() {
        GM_setValue('pageVisits', []);
        alert('所有访问数据已被删除。');
    }

    // 每天仅清理一次数据（仅保留最近 maxDays 天的数据）
    const lastClearTime = GM_getValue('lastClearTime', '');
    const today = new Date().toDateString();
    if (lastClearTime !== today) {
        clearOldData();
        GM_setValue('lastClearTime', today);
    }

    // 在页面卸载时存储访问数据
    window.addEventListener('beforeunload', storeVisit);

    // 每秒更新一次标题栏中的时间显示
    setInterval(updateTitle, 1000);

    /***************************************
     * 摘要与饼图页面生成（美化版）
     ***************************************/
    GM_registerMenuCommand('显示每日摘要', function() {
        const summaryPageContent = generateSummaryPage();
        const summaryWindow = window.open('', '_blank');
        if (summaryWindow) {
            summaryWindow.document.open();
            summaryWindow.document.write(summaryPageContent);
            summaryWindow.document.close();
        } else {
            alert("无法打开摘要窗口，请检查浏览器的弹窗拦截设置。");
        }
    });

    GM_registerMenuCommand('删除所有数据', deleteAllData);

    // 生成摘要页面内容（仅统计当天数据）
    function generateSummaryPage() {
        const visits = GM_getValue('pageVisits', []);
        const today = new Date().toDateString();
        const todayVisits = visits.filter(visit => visit.date === today);

        // 按域名分组统计访问数据
        const domainVisits = todayVisits.reduce((acc, visit) => {
            const domain = getDomain(visit.url);
            if (!acc[domain]) {
                acc[domain] = { domain, timeSpent: 0, pages: [] };
            }
            acc[domain].timeSpent += visit.timeSpent;
            acc[domain].pages.push(visit);
            return acc;
        }, {});

        const totalSeconds = Object.values(domainVisits).reduce((sum, domain) => sum + domain.timeSpent, 0);

        // 美化摘要页面的 HTML 和 CSS
        let summaryHTML = '<html><head><title>每日摘要</title><meta charset="utf-8">';
        summaryHTML += '<style>';
        summaryHTML += 'body { font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif; margin: 0; padding: 20px; background: linear-gradient(to bottom right, #f7f7f7, #eaeaea); }';
        summaryHTML += '.container { max-width: 1000px; margin: 40px auto; background: #fff; border-radius: 8px; padding: 30px; box-shadow: 0 4px 10px rgba(0,0,0,0.1); }';
        summaryHTML += 'h1 { text-align: center; margin-bottom: 20px; color: #333; }';
        summaryHTML += 'p { text-align: center; margin-bottom: 20px; font-size: 1.2em; color: #666; }';
        summaryHTML += 'table { width: 100%; border-collapse: collapse; margin-bottom: 30px; }';
        summaryHTML += 'th, td { padding: 12px 15px; border: 1px solid #ddd; text-align: center; }';
        summaryHTML += 'th { background-color: #4CAF50; color: #fff; }';
        summaryHTML += 'tr:nth-child(even) { background-color: #f3f3f3; }';
        summaryHTML += 'tr:hover { background-color: #f1f1f1; }';
        summaryHTML += 'canvas { display: block; margin: 0 auto; max-width: 100%; }';
        summaryHTML += '</style></head><body>';
        summaryHTML += '<div class="container">';
        summaryHTML += '<h1>每日摘要</h1>';
        summaryHTML += `<p>总花费时间：${formatTimeMS(totalSeconds)}</p>`;
        summaryHTML += '<table><tr><th>域名</th><th>花费时间</th><th>百分比</th></tr>';

        Object.values(domainVisits).forEach(domain => {
            const percentage = totalSeconds > 0 ? ((domain.timeSpent / totalSeconds) * 100).toFixed(2) : 0;
            summaryHTML += `<tr><td>${domain.domain}</td><td>${formatTimeMS(domain.timeSpent)}</td><td>${percentage}%</td></tr>`;
        });

        summaryHTML += '</table>';
        summaryHTML += '<canvas id="timeChart" width="800" height="600"></canvas>';
        summaryHTML += '</div>';
        summaryHTML += '<script src="https://cdn.jsdelivr.net/npm/chart.js"></script>';
        summaryHTML += '<script src="https://cdn.jsdelivr.net/npm/chartjs-plugin-datalabels"></script>';
        summaryHTML += '<script>';
        summaryHTML += 'const ctx = document.getElementById("timeChart").getContext("2d");';
        summaryHTML += 'const data = {';
        summaryHTML += 'labels: ' + JSON.stringify(Object.keys(domainVisits)) + ',';
        summaryHTML += 'datasets: [{';
        summaryHTML += 'label: "花费时间",';
        summaryHTML += 'data: ' + JSON.stringify(Object.values(domainVisits).map(domain => domain.timeSpent)) + ',';
        summaryHTML += 'backgroundColor: ' + JSON.stringify(Object.values(domainVisits).map((_, i) => `hsl(${i * 360 / Object.values(domainVisits).length}, 70%, 70%)`)) + ',';
        summaryHTML += '}]';
        summaryHTML += '};';
        summaryHTML += 'const config = { type: "pie", data: data, options: { plugins: { datalabels: { formatter: (value, ctx) => {';
        summaryHTML += 'let total = ctx.chart.data.datasets[0].data.reduce((a, b) => a + b, 0);';
        summaryHTML += 'let percentage = (value / total * 100).toFixed(2) + "%";';
        summaryHTML += 'return percentage; } } } } };';
        summaryHTML += 'Chart.register(ChartDataLabels);';
        summaryHTML += 'new Chart(ctx, config);';
        summaryHTML += '<\/script>';
        summaryHTML += '</body></html>';

        return summaryHTML;
    }

    /***************************************
     * 时间提醒功能（默认关闭）
     ***************************************/
    /*
    // 如果用户在同一页面停留超过30分钟，则弹出提醒（默认关闭）
    function checkLongSession() {
        const elapsedSeconds = Math.floor((new Date() - startTime) / 1000);
        if (elapsedSeconds >= 1800) { // 30分钟 = 1800秒
            alert("你已经在这个网站上停留超过 30 分钟了！");
        }
    }
    setInterval(checkLongSession, 60000); // 每分钟检查一次
    */
})();
